import "./App.css";
import {HeroSection, Navigation, Products, Location, About} from "./components";
import '@fortawesome/fontawesome-free/css/all.min.css';

const App = () => {
  return (
    <div>
      <Navigation />
      <HeroSection />
      <Products/>
      {/* <Location/> */}
      <About/>
    </div>
  );
};

export default App;
